<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="minimum-scale=1, initial-scale=1, width=device-width, shrink-to-fit=no"
    >
    <link rel="shortcut icon" href="https://acari.io/reach.ico">
    <meta name="theme-color" content="#000000">
    <link rel="stylesheet"
          type="text/css"
          href="https://fonts.googleapis.com/css?family=Roboto:300,400,500">
    <style>
        .backdrop {

        }

        img {
            max-width: 100%;
            vertical-align: middle;
        }


        html {
            font-family: -apple-system,BlinkMacSystemFont,Segoe UI,Roboto,Oxygen,Ubuntu,Cantarell,Fira Sans,Droid Sans,Helvetica Neue,sans-serif;
            -webkit-font-smoothing: antialiased;
            -moz-osx-font-smoothing: grayscale;
            background: linear-gradient(#E0E0E0, #E0E0E0, rgba(86, 88, 101, 0.83)) fixed;
            height: 100%;
        }

        body {
            margin: 0;
            padding: 0;
            -webkit-font-smoothing: antialiased;
            -moz-osx-font-smoothing: grayscale;
        }

        code {
            font-family: source-code-pro, Menlo, Monaco, Consolas, "Courier New",
            monospace;
        }

        .content {
            margin-left: 24px;
            margin-right: 24px;
            padding: 1em;
        }

        .shrug-container{
            padding: 1em;
            margin-top: 2em;
            text-align: center;
            border-radius: 5px;
        }


        .go-home-container {
            color: #eeeeee;
            background-color: rgba(55,55,55,0.75);
            border-radius: 5px;
            text-align: center;
            margin: 32px auto;
            padding: 48px;
            max-width: 400px;
            cursor: pointer;
            box-shadow: 0px 1px 5px 0px rgba(0, 0, 0, 0.2), 0px 2px 2px 0px rgba(0, 0, 0, 0.14), 0px 3px 1px -2px rgba(0, 0, 0, 0.12);
        }

        .go-home-container:hover {
            box-shadow: 0px 1px 5px 0px rgba(10,6,101, 0.52),
            0px 2px 2px 0px rgba(10,6,101, 0.54),
            0px 3px 1px -2px rgba(10,6,101, 0.52)
        }

        .footer {
            text-align: center;
        }

        .reach{
            width: 100%;
            height: auto;
        }

        .btn-primary {
            color: #fff;
            background-color: #007bff;
            border-color: #007bff;
        }

        .btn {
            display: inline-block;
            font-weight: 400;
            text-align: center;
            vertical-align: middle;
            -webkit-user-select: none;
            -moz-user-select: none;
            -ms-user-select: none;
            user-select: none;
            border: 1px solid transparent;
            padding: .375rem .75rem;
            font-size: 1rem;
            line-height: 1.5;
            border-radius: .25rem;
            transition: color .15s ease-in-out,background-color .15s ease-in-out,border-color .15s ease-in-out,box-shadow .15s ease-in-out;
        }

    </style>
    <title>Acari Unkown</title>
</head>
